import React, { useEffect, useState } from "react";
import Navbar from "./Components/Navbar";
import LandingPage from "./Components/LandingPage";
import "./App.css";

function App() {
  const [load, setLoad] = useState(true);

  useEffect(() => {
    setTimeout(() => setLoad(true), 3000);
  }, []);

  return (
    <main className="">
      {load && <LandingPage />}

      {!load && <Navbar />}
    </main>
  );
}

export default App;
